import axios from "axios";


export const header = {
   "listUser": {
        title: "List User",
        buttonName:"Add User",
        linkTo:"../user"
    },
    "addUser": {
        title: "Add User",
        buttonName:"Go back",
        linkTo:"./issues/list"
    },
    "updateUser":{
        title: "Update User",
        buttonName:"Go back",
        linkTo:"./issues/list"
    }
}

export const getListUser = async(url:string) => {
    const res = await fetch(
        "https://635017b9df22c2af7b630c3e.mockapi.io/api/v1/users"
    )
    return res;
}
